Rekhila Promotion vous propose un F4 spacieux dans sa résidence au design moderne Besma II. 
La résidence est situé à l'entrée de Boufarik avec un accès direct par autoroute et une proximité de la ville de Boufarik. Elle offre également de nombreuses commodités comme :

- Un service de gardiennage ;
- Des caméras de surveillance ;
- Un air de jeux ;
- Une salle de sport ;
- Des box de parking ;
- Ascenseurs. 

Cet f4 est doté de 3 chambres spacieuses, d'un séjour/ cuisine open space et d'un grand balcon. L'appartement est aussi équipé d'une climatisation, d'un chauffage centrale, ainsi que d'une cuisine et une salle de bain aménagées avec des matériaux de qualité au design moderne.

GAEA Promotion, lance la vente de plusieurs type d'appartements Promotionnels à la résidence les OLIVIER sise à Koléa, dans la Wilaya de TIPAZA !
située à Koléa en allant vers Blida, un vrai chef-d'œuvre digne de son nom réalisée par le Groupe GAEA, bénéficie d'un cadre de vie aussi pratique qu'agréable.

Ce programme immobilier est réparti sur cinq ilots centraux. Ces derniers profitent d'un design particulièrement soigné avec un maximum de fonctionnalités :

- Accès contrôlé via un digicode ;
- Ascenseurs avec accès directe à partir du parking ;
-Porte d'entrée sécurisée, blindées pour chaque appartement ;
- Portes fenêtres et fenêtres en PVC ;
- Suite parentale ;
- Cuisine moderne équipée ;
- Salle de bain équipée avec des équipements de haut de gamme ;
- Réserve d’eau pour une alimentation en eau potable d’une manière continue ;
- Chauffage central ;
- Parking en sous-sol ;
- Gardiennage 24h/24h par une entreprise de gestion des parties communes (Administrateur de biens)
- Parabole collective avec un système de télédistribution centralisé avec 04 assiettes et prise TV dans toutes les pièces (Séjour, chambres et Cuisine) ;
- Revêtements sol et mur de haute qualité ;
- Système de sécurité incendie ;
- Détection incendie et désenfumage

Un panel de commodités est mis à votre disposition :
-Vente sur plan VSP ;
-Acte notarié ;
-Caméra de surveillance ;
-Des esplanades aménagées en aires de repos et jeux

GAEA Promotion, vous accompagne pour accéder à la propriété en vous offrant les possibilités de :
-Crédit bancaire avec un taux bonifié ;
-Paiement par tranches ;

